const App = () => {
  function darken_screen(yesno) {
    if (yesno == true) {
      document.querySelector(".screen-darken").classList.add("active");
    } else if (yesno == false) {
      document.querySelector(".screen-darken").classList.remove("active");
    }
  }

  function close_offcanvas() {
    darken_screen(false);
    document.querySelector(".mobile-offcanvas.show").classList.remove("show");
    document.body.classList.remove("offcanvas-active");
  }

  function show_offcanvas(offcanvas_id) {
    darken_screen(true);
    document.getElementById(offcanvas_id).classList.add("show");
    document.body.classList.add("offcanvas-active");
  }

  document.addEventListener("DOMContentLoaded", function () {
    document
      .querySelectorAll("[data-trigger]")
      .forEach(function (everyelement) {
        let offcanvas_id = everyelement.getAttribute("data-trigger");

        everyelement.addEventListener("click", function (e) {
          e.preventDefault();
          show_offcanvas(offcanvas_id);
        });
      });

    document.querySelectorAll(".btn-close").forEach(function (everybutton) {
      everybutton.addEventListener("click", function (e) {
        e.preventDefault();
        close_offcanvas();
      });
    });

    document
      .querySelector(".screen-darken")
      .addEventListener("click", function (event) {
        close_offcanvas();
      });
  });
  return (
    <>
      <div>app</div>
      <span className="screen-darken"></span>

      <div>
        <button
          data-trigger="navbar_main"
          className="d-lg-none btn btn-warning"
          type="button"
        >
          Show navbar
        </button>
        <button
          data-trigger="card_mobile"
          className="d-lg-none btn btn-warning"
          type="button"
        >
          Show card
        </button>

        <nav
          id="navbar_main"
          className="mobile-offcanvas navbar navbar-expand-lg navbar-dark bg-primary"
        >
          <div className="container-fluid">
            <div className="offcanvas-header">
              <button className="btn-close float-end"></button>
            </div>
            <a className="navbar-brand" href="#a">
              Brand
            </a>

            <ul className="navbar-nav">
              <li className="nav-item active">
                <a className="nav-link" href="#a">
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#a">
                  About
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#a">
                  Services
                </a>
              </li>
              <li className="nav-item dropdown">
                <a
                  className="nav-link dropdown-toggle"
                  href="#a"
                  data-bs-toggle="dropdown"
                >
                  More items
                </a>
                <ul className="dropdown-menu">
                  <li>
                    <a className="dropdown-item" href="#a">
                      Submenu item 1
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#a">
                      Submenu item 2
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#a">
                      Submenu item 3
                    </a>
                  </li>
                </ul>
              </li>
            </ul>
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <a className="nav-link" href="#a">
                  Menu item
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#a">
                  Menu item
                </a>
              </li>
              <li className="nav-item dropdown">
                <a
                  className="nav-link dropdown-toggle"
                  href="#a"
                  data-bs-toggle="dropdown"
                >
                  Dropdown right
                </a>
                <ul className="dropdown-menu dropdown-menu-end">
                  <li>
                    <a className="dropdown-item" href="#a">
                      Submenu item 1
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#a">
                      Submenu item 2
                    </a>
                  </li>
                </ul>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    </>
  );
};

export default App;
